  function cleanInputs(value, type) {
    var retorn;

    if (value == "undefined" || typeof value === "undefined" || typeof type === "undefined") {
      return "";
    }

    if (type === "int") {
      retorn = parseInt(value);

      if (isNaN(retorn)) {
        retorn = "";
      }
    } else if (type === "double") {
      if (!isNaN(parseFloat(value))) {
        if (!isFinite(value)) {
          retorn = "";
        } else {
          retorn = parseFloat(parseFloat(value).toFixed(2));
        }
      } else {
        retorn = "";
      }
    } else if (type === "string") {
      retorn = value;
    } else {
      retorn = "";
    }

    return retorn;
  }

  function validateInput(value, type) {
    var retorn;

    if (value == "undefined" || typeof value === "undefined" || typeof type === "undefined") {
      retorn = false;
    } else {
      if (type === "int") {
        retorn = parseInt(value);

        if (isNaN(retorn)) {
          retorn = false;
        } else {
          retorn = true;
        }
      } else if (type === "double") {
        if (!isNaN(parseFloat(value))) {
          if (!isFinite(value)) {
            retorn = false;
          } else {
            retorn = true;
          }
        } else {
          retorn = false;
        }
      } else {
        retorn = true;
      }
    }

    return retorn;
  } //****************************************************************
